package com.thalhamer.numbersgame.domain;import android.graphics.RectF;/** * Created by Brian on 7/4/2015. */public class AfterGameTouchableObjects {    RectF cancelRectF;    RectF retryRectF;    RectF nextRectF;    public AfterGameTouchableObjects(RectF cancelRectF, RectF retryRectF, RectF nextRectF) {        this.cancelRectF = cancelRectF;        this.retryRectF = retryRectF;        this.nextRectF = nextRectF;    }    public RectF getCancelRectF() {        return cancelRectF;    }    public void setCancelRectF(RectF cancelRectF) {        this.cancelRectF = cancelRectF;    }    public RectF getRetryRectF() {        return retryRectF;    }    public void setRetryRectF(RectF retryRectF) {        this.retryRectF = retryRectF;    }    public RectF getNextRectF() {        return nextRectF;    }    public void setNextRectF(RectF nextRectF) {        this.nextRectF = nextRectF;    }}